/*Table structure for table `appointmentinformation` */

DROP TABLE IF EXISTS `appointmentinformation`;

CREATE TABLE `appointmentinformation` (
  `id` varchar(64) NOT NULL COMMENT '预约上门信息表id标识',
  `fullName` varchar(32) DEFAULT NULL COMMENT '姓名',
  `phone` varchar(32) DEFAULT NULL COMMENT '电话号码',
  `region` varchar(32) DEFAULT NULL COMMENT '地区',
  `address` varchar(64) DEFAULT NULL COMMENT '详细地址',
  `yqPhone` varchar(32) DEFAULT NULL COMMENT '邀请人电话号码',
  `state` int(11) DEFAULT '0' COMMENT '状态,0..',
  `cdate` datetime DEFAULT NULL COMMENT '创建时间',
  `mdate` datetime DEFAULT NULL COMMENT '最后修改时间',
  `creator` varchar(64) DEFAULT NULL COMMENT '创建人',
  `modify` varchar(64) DEFAULT NULL COMMENT '修改人',
  `version` varchar(64) DEFAULT '0' COMMENT '数据版本',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='预约上门信息表';

