/*Table structure for table `clothinginfo` */

DROP TABLE IF EXISTS `clothinginfo`;

CREATE TABLE `clothinginfo` (
  `id` varchar(64) NOT NULL COMMENT '服装信息表id标识',
  `styletypeinfoId` varchar(64) DEFAULT NULL COMMENT '服装款式分类信息id',
  `styleName` varchar(32) NOT NULL COMMENT '款式名称',
  `clothingName` varchar(255) NOT NULL COMMENT '服装名称',
  `lable` varchar(32) DEFAULT NULL COMMENT '标签',
  `material` varchar(255) DEFAULT NULL COMMENT '材质说明',
  `salesPrice` varchar(32) DEFAULT NULL COMMENT '销售价',
  `tagPrice` varchar(32) DEFAULT NULL COMMENT '吊牌价',
  `imgCover` text COMMENT '封面图',
  `imgArray` text COMMENT '轮播图',
  `infoImgArray` text COMMENT '服装信息详细图',
  `isDisplay` varchar(32) DEFAULT '是' COMMENT '是否显示',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `state` int(11) DEFAULT '0' COMMENT '状态,0..',
  `cdate` datetime DEFAULT NULL COMMENT '创建时间',
  `mdate` datetime DEFAULT NULL COMMENT '最后修改时间',
  `creator` varchar(64) DEFAULT NULL COMMENT '创建人',
  `modify` varchar(64) DEFAULT NULL COMMENT '修改人',
  `version` varchar(64) DEFAULT '0' COMMENT '数据版本',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='服装信息表';

