/*Table structure for table `syslog` */

DROP TABLE IF EXISTS `syslog`;

CREATE TABLE `syslog` (
  `id` varchar(64) NOT NULL COMMENT '系统日志表id标识',
  `ip` varchar(64) DEFAULT NULL COMMENT '来源id',
  `userName` varchar(64) DEFAULT '游客' COMMENT '用户名',
  `model` text COMMENT '模块',
  `operationType` text COMMENT '操作类型',
  `abnormal` text COMMENT '异常',
  `state` int(11) DEFAULT '0' COMMENT '状态,0..',
  `cdate` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `mdate` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `creator` varchar(64) DEFAULT 'admin' COMMENT '创建人',
  `modify` varchar(64) DEFAULT 'admin' COMMENT '修改人',
  `version` varchar(64) DEFAULT '0' COMMENT '数据版本',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统日志表';

